import React from "react";
import "./Header.css";

function Header() {
	return (
		<div>
			<div class="header ">

				<img src="./assets/bg1.jpg" class="img-fluid img-bg " alt="" />
				<div class=" about text-white m-4">
			<Tittle></Tittle>
					<p>
						Llevamos más 10 años ofreciendo productos de las mejores marcas y
						dando el soporte técnico que garantiza un servicio de excelente
						calidad a unos precios competitivos y favorables para su economia
					</p>
				</div>
			</div>
		</div>
	);
}
export default Header;
